import{_ as e,o as t,c,d as T}from"./app.91a380bb.js";const i={},p=T('<h1 id="\u9762\u8BD5\u5B98-\u4EC0\u4E48\u662F-http-http-\u548C-https-\u7684\u533A\u522B" tabindex="-1"><a class="header-anchor" href="#\u9762\u8BD5\u5B98-\u4EC0\u4E48\u662F-http-http-\u548C-https-\u7684\u533A\u522B" aria-hidden="true">#</a> \u9762\u8BD5\u5B98\uFF1A\u4EC0\u4E48\u662F HTTP? HTTP \u548C HTTPS \u7684\u533A\u522B?</h1><p><img src="https://static.vue-js.com/f50c71f0-b20b-11eb-ab90-d9ae814b240d.png" alt=""></p><h2 id="\u4E00\u3001http" tabindex="-1"><a class="header-anchor" href="#\u4E00\u3001http" aria-hidden="true">#</a> \u4E00\u3001HTTP</h2><p><code>HTTP</code> (HyperText Transfer Protocol)\uFF0C\u5373\u8D85\u6587\u672C\u8FD0\u8F93\u534F\u8BAE\uFF0C\u662F\u5B9E\u73B0\u7F51\u7EDC\u901A\u4FE1\u7684\u4E00\u79CD\u89C4\u8303</p><p><img src="https://static.vue-js.com/fda119b0-b20b-11eb-85f6-6fac77c0c9b3.png" alt=""></p><p>\u5728\u8BA1\u7B97\u673A\u548C\u7F51\u7EDC\u4E16\u754C\u6709\uFF0C\u5B58\u5728\u4E0D\u540C\u7684\u534F\u8BAE\uFF0C\u5982\u5E7F\u64AD\u534F\u8BAE\u3001\u5BFB\u5740\u534F\u8BAE\u3001\u8DEF\u7531\u534F\u8BAE\u7B49\u7B49......</p><p>\u800C<code>HTTP</code>\u662F\u4E00\u4E2A\u4F20\u8F93\u534F\u8BAE\uFF0C\u5373\u5C06\u6570\u636E\u7531 A \u4F20\u5230 B \u6216\u5C06 B \u4F20\u8F93\u5230 A\uFF0C\u5E76\u4E14 A \u4E0E B \u4E4B\u95F4\u80FD\u591F\u5B58\u653E\u5F88\u591A\u7B2C\u4E09\u65B9\uFF0C\u5982\uFF1A A&lt;=&gt;X&lt;=&gt;Y&lt;=&gt;Z&lt;=&gt;B</p><p>\u4F20\u8F93\u7684\u6570\u636E\u5E76\u4E0D\u662F\u8BA1\u7B97\u673A\u5E95\u5C42\u4E2D\u7684\u4E8C\u8FDB\u5236\u5305\uFF0C\u800C\u662F\u5B8C\u6574\u7684\u3001\u6709\u610F\u4E49\u7684\u6570\u636E\uFF0C\u5982 HTML \u6587\u4EF6, \u56FE\u7247\u6587\u4EF6, \u67E5\u8BE2\u7ED3\u679C\u7B49\u8D85\u6587\u672C\uFF0C\u80FD\u591F\u88AB\u4E0A\u5C42\u5E94\u7528\u8BC6\u522B</p><p>\u5728\u5B9E\u9645\u5E94\u7528\u4E2D\uFF0C<code>HTTP</code>\u5E38\u88AB\u7528\u4E8E\u5728<code>Web</code>\u6D4F\u89C8\u5668\u548C\u7F51\u7AD9\u670D\u52A1\u5668\u4E4B\u95F4\u4F20\u9012\u4FE1\u606F\uFF0C\u4EE5\u660E\u6587\u65B9\u5F0F\u53D1\u9001\u5185\u5BB9\uFF0C\u4E0D\u63D0\u4F9B\u4EFB\u4F55\u65B9\u5F0F\u7684\u6570\u636E\u52A0\u5BC6</p><p>\u7279\u70B9\u5982\u4E0B\uFF1A</p><ul><li><p>\u652F\u6301\u5BA2\u6237/\u670D\u52A1\u5668\u6A21\u5F0F</p></li><li><p>\u7B80\u5355\u5FEB\u901F\uFF1A\u5BA2\u6237\u5411\u670D\u52A1\u5668\u8BF7\u6C42\u670D\u52A1\u65F6\uFF0C\u53EA\u9700\u4F20\u9001\u8BF7\u6C42\u65B9\u6CD5\u548C\u8DEF\u5F84\u3002\u7531\u4E8E HTTP \u534F\u8BAE\u7B80\u5355\uFF0C\u4F7F\u5F97 HTTP \u670D\u52A1\u5668\u7684\u7A0B\u5E8F\u89C4\u6A21\u5C0F\uFF0C\u56E0\u800C\u901A\u4FE1\u901F\u5EA6\u5F88\u5FEB</p></li><li><p>\u7075\u6D3B\uFF1AHTTP \u5141\u8BB8\u4F20\u8F93\u4EFB\u610F\u7C7B\u578B\u7684\u6570\u636E\u5BF9\u8C61\u3002\u6B63\u5728\u4F20\u8F93\u7684\u7C7B\u578B\u7531 Content-Type \u52A0\u4EE5\u6807\u8BB0</p></li><li><p>\u65E0\u8FDE\u63A5\uFF1A\u65E0\u8FDE\u63A5\u7684\u542B\u4E49\u662F\u9650\u5236\u6BCF\u6B21\u8FDE\u63A5\u53EA\u5904\u7406\u4E00\u4E2A\u8BF7\u6C42\u3002\u670D\u52A1\u5668\u5904\u7406\u5B8C\u5BA2\u6237\u7684\u8BF7\u6C42\uFF0C\u5E76\u6536\u5230\u5BA2\u6237\u7684\u5E94\u7B54\u540E\uFF0C\u5373\u65AD\u5F00\u8FDE\u63A5\u3002\u91C7\u7528\u8FD9\u79CD\u65B9\u5F0F\u53EF\u4EE5\u8282\u7701\u4F20\u8F93\u65F6\u95F4</p></li><li><p>\u65E0\u72B6\u6001\uFF1AHTTP \u534F\u8BAE\u65E0\u6CD5\u6839\u636E\u4E4B\u524D\u7684\u72B6\u6001\u8FDB\u884C\u672C\u6B21\u7684\u8BF7\u6C42\u5904\u7406</p></li></ul><h2 id="\u4E8C\u3001https" tabindex="-1"><a class="header-anchor" href="#\u4E8C\u3001https" aria-hidden="true">#</a> \u4E8C\u3001HTTPS</h2><p>\u5728\u4E0A\u8FF0\u4ECB\u7ECD<code>HTTP</code>\u4E2D\uFF0C\u4E86\u89E3\u5230<code>HTTP</code>\u4F20\u9012\u4FE1\u606F\u662F\u4EE5\u660E\u6587\u7684\u5F62\u5F0F\u53D1\u9001\u5185\u5BB9\uFF0C\u8FD9\u5E76\u4E0D\u5B89\u5168\u3002\u800C<code>HTTPS</code>\u51FA\u73B0\u6B63\u662F\u4E3A\u4E86\u89E3\u51B3<code>HTTP</code>\u4E0D\u5B89\u5168\u7684\u7279\u6027</p><p>\u4E3A\u4E86\u4FDD\u8BC1\u8FD9\u4E9B\u9690\u79C1\u6570\u636E\u80FD\u52A0\u5BC6\u4F20\u8F93\uFF0C\u8BA9<code>HTTP</code>\u8FD0\u884C\u5B89\u5168\u7684<code>SSL/TLS</code>\u534F\u8BAE\u4E0A\uFF0C\u5373 HTTPS = HTTP + SSL/TLS\uFF0C\u901A\u8FC7 <code>SSL</code>\u8BC1\u4E66\u6765\u9A8C\u8BC1\u670D\u52A1\u5668\u7684\u8EAB\u4EFD\uFF0C\u5E76\u4E3A\u6D4F\u89C8\u5668\u548C\u670D\u52A1\u5668\u4E4B\u95F4\u7684\u901A\u4FE1\u8FDB\u884C\u52A0\u5BC6</p><p><code>SSL</code> \u534F\u8BAE\u4F4D\u4E8E<code> TCP/IP</code> \u534F\u8BAE\u4E0E\u5404\u79CD\u5E94\u7528\u5C42\u534F\u8BAE\u4E4B\u95F4\uFF0C\u6D4F\u89C8\u5668\u548C\u670D\u52A1\u5668\u5728\u4F7F\u7528 <code>SSL</code> \u5EFA\u7ACB\u8FDE\u63A5\u65F6\u9700\u8981\u9009\u62E9\u4E00\u7EC4\u6070\u5F53\u7684\u52A0\u5BC6\u7B97\u6CD5\u6765\u5B9E\u73B0\u5B89\u5168\u901A\u4FE1\uFF0C\u4E3A\u6570\u636E\u901A\u8BAF\u63D0\u4F9B\u5B89\u5168\u652F\u6301</p><p><img src="https://static.vue-js.com/078c50c0-b20c-11eb-ab90-d9ae814b240d.png" alt=""></p><p>\u6D41\u7A0B\u56FE\u5982\u4E0B\u6240\u793A\uFF1A</p><p><img src="https://static.vue-js.com/0e409fc0-b20c-11eb-85f6-6fac77c0c9b3.png" alt=""></p><ul><li>\u9996\u5148\u5BA2\u6237\u7AEF\u901A\u8FC7 URL \u8BBF\u95EE\u670D\u52A1\u5668\u5EFA\u7ACB SSL \u8FDE\u63A5</li><li>\u670D\u52A1\u7AEF\u6536\u5230\u5BA2\u6237\u7AEF\u8BF7\u6C42\u540E\uFF0C\u4F1A\u5C06\u7F51\u7AD9\u652F\u6301\u7684\u8BC1\u4E66\u4FE1\u606F\uFF08\u8BC1\u4E66\u4E2D\u5305\u542B\u516C\u94A5\uFF09\u4F20\u9001\u4E00\u4EFD\u7ED9\u5BA2\u6237\u7AEF</li><li>\u5BA2\u6237\u7AEF\u7684\u670D\u52A1\u5668\u5F00\u59CB\u534F\u5546 SSL \u8FDE\u63A5\u7684\u5B89\u5168\u7B49\u7EA7\uFF0C\u4E5F\u5C31\u662F\u4FE1\u606F\u52A0\u5BC6\u7684\u7B49\u7EA7</li><li>\u5BA2\u6237\u7AEF\u7684\u6D4F\u89C8\u5668\u6839\u636E\u53CC\u65B9\u540C\u610F\u7684\u5B89\u5168\u7B49\u7EA7\uFF0C\u5EFA\u7ACB\u4F1A\u8BDD\u5BC6\u94A5\uFF0C\u7136\u540E\u5229\u7528\u7F51\u7AD9\u7684\u516C\u94A5\u5C06\u4F1A\u8BDD\u5BC6\u94A5\u52A0\u5BC6\uFF0C\u5E76\u4F20\u9001\u7ED9\u7F51\u7AD9</li><li>\u670D\u52A1\u5668\u5229\u7528\u81EA\u5DF1\u7684\u79C1\u94A5\u89E3\u5BC6\u51FA\u4F1A\u8BDD\u5BC6\u94A5</li><li>\u670D\u52A1\u5668\u5229\u7528\u4F1A\u8BDD\u5BC6\u94A5\u52A0\u5BC6\u4E0E\u5BA2\u6237\u7AEF\u4E4B\u95F4\u7684\u901A\u4FE1</li></ul><h2 id="\u4E09\u3001\u533A\u522B" tabindex="-1"><a class="header-anchor" href="#\u4E09\u3001\u533A\u522B" aria-hidden="true">#</a> \u4E09\u3001\u533A\u522B</h2><ul><li>HTTPS \u662F HTTP \u534F\u8BAE\u7684\u5B89\u5168\u7248\u672C\uFF0CHTTP \u534F\u8BAE\u7684\u6570\u636E\u4F20\u8F93\u662F\u660E\u6587\u7684\uFF0C\u662F\u4E0D\u5B89\u5168\u7684\uFF0CHTTPS \u4F7F\u7528\u4E86 SSL/TLS \u534F\u8BAE\u8FDB\u884C\u4E86\u52A0\u5BC6\u5904\u7406\uFF0C\u76F8\u5BF9\u66F4\u5B89\u5168</li><li>HTTP \u548C HTTPS \u4F7F\u7528\u8FDE\u63A5\u65B9\u5F0F\u4E0D\u540C\uFF0C\u9ED8\u8BA4\u7AEF\u53E3\u4E5F\u4E0D\u4E00\u6837\uFF0CHTTP \u662F 80\uFF0CHTTPS \u662F 443</li><li>HTTPS \u7531\u4E8E\u9700\u8981\u8BBE\u8BA1\u52A0\u5BC6\u4EE5\u53CA\u591A\u6B21\u63E1\u624B\uFF0C\u6027\u80FD\u65B9\u9762\u4E0D\u5982 HTTP</li><li>HTTPS \u9700\u8981 SSL\uFF0CSSL \u8BC1\u4E66\u9700\u8981\u94B1\uFF0C\u529F\u80FD\u8D8A\u5F3A\u5927\u7684\u8BC1\u4E66\u8D39\u7528\u8D8A\u9AD8</li></ul>',21),d=[p];function a(l,o){return t(),c("div",null,d)}const s=e(i,[["render",a],["__file","HTTP_HTTPS.html.vue"]]);export{s as default};
